import React from 'react';
import '../App.css';
import { Button } from './Button';
import './Values.css';

function ValuesSection() {
  return (
    <div className='values-container'>
    <div className='values-text-container'>


    <h1>Values</h1>
    <br />
    <p><b>Innovation</b> : Passion for developing solutions which can improve businesses and lives.  </p>
    <br />
    <p><b>Simplicity</b> : Always challenge to find the most simple solutions to enable understanding and reduce risk.  </p>
    <br />
    <p><b>Ethics</b> : Approach business with high ethical principles and actively engage in discussions about Ethics within the Fintech community.  </p>
    <br />
    <p><b>Methodical Action</b> : Be action oriented but use methodical approaches.  </p>
    <br />
    <p><b>Open to Ideas</b> : Welcome honest exchanges and be open to different persepectives and new ideas.  </p>
    <br />
    </div>
    </div>


  );
}

export default ValuesSection;
